import React from "react";

function MyName() {
    return(
        <h1>Tomas</h1>
    );
}
function AboutMySelf() {
    return (
        <p>
            a paragraph about my self
        </p>
    );
}
function FavoriteVacation() {
    return(
        <ul>
            <li>uno</li>
            <li>dos</li>
            <li>tres</li>
        </ul>
    );
}

function MyInfo() {
    return(
        <div>
            <MyName />
            <AboutMySelf />
            <FavoriteVacation />
        </div>
    );
}

export default MyInfo;
